const styles = {

    footer: {
        marginTop: 200
    },

    hyperlinkStyle: {
        color: 'blue',
    },

    input: {
        height: 60,
        backgroundColor: '#FFF',
        borderRadius: 10,
        marginBottom: 8,
        paddingHorizontal: 24,
        fontSize: 16,
        borderWidth: 0,
    },

    main: {
        flex: 1,
        justifyContent: 'center'
    },

    title: {
        color: '#322153',
        fontSize: 15,
        fontFamily: 'Ubuntu_700Bold',
        maxWidth: 360,
        marginTop: 25,
        textAlign: 'center'
    },
}

export default styles;
